Anda bisa menggunakan tombol media untuk mengatur pemutaran dari layanan-layanan yang didukung. Ketika anda menonton/mendengar sesuatu di salah satu layanan yang kami dukung, ekstensi pada browser web mengirim metadata dari video/lagu ke aplikasi desktop kami dan PreMiD memprosesnya. PreMiD mengirim informasi ke Discord dengan format yang tepat dan mengubah statusnya.

